import React, {Component} from 'react';
import {Steps} from "antd";

import resetStyle from './index.module.css';

const {Step}=Steps;

class ResetPwd extends Component {
    render() {
        return (
            <div className={resetStyle.frame}>
                <h3>找回密码</h3>
                <Steps>
                    <Step title='1'/>
                    <Step title='2'/>
                    <Step title='3'/>
                </Steps>
            </div>
        );
    }
}

export default ResetPwd;
